    <h3 {...{
      "id": "active-team"
    }}>{`Active team`}</h3>
    <p>{`OpenCRVS has been a collaborative effort since the very beginning, with Plan International and Jembi Health Systems leading product development. The incubation of the product has been made possible through the generous support of the Department of Foreign Affairs and Trade Australia, Vital Strategies and the Bloomberg Data for Health Initiative, Digital Square, DIAL and Plan International.`}</p>
    <p>{`Let us introduce you to the current team who is thoughtfully bringing the product to life.`}</p>
    <p><strong parentName="p">{`Edward Duffus:`}</strong>{` As founder of OpenCRVS, Ed has set the product vision and continues to challenge the orthodoxies of traditional CRVS so that civil registration systems around the world may realise their full potential and ensure that no-one is left behind.`}</p>
    <p><strong parentName="p">{`Annina Wersun:`}</strong>{` Product Owner and Implementation Lead. Annina leads the product team and brings the voice of civil registration users around the world to every product decision.`}</p>
    <p><strong parentName="p">{`Jonathan Pye-Finch:`}</strong>{` Research and insight driven, JPF brings human-centred design principles, lean methodologies and collaborative problem solving to OpenCRVS as Design Lead.`}</p>
    <p><strong parentName="p">{`Euan Millar:`}</strong>{` Technical Architect and Scrum Master. `}<a parentName="p" {...{
        "href": "https://github.com/euanmillar"
      }}>{`Euan`}</a>{` directs the international software development team from London and contributes code across developer operations and the full stack.`}</p>
    <p><strong parentName="p">{`Mushraful Hoque Anik:`}</strong>{` `}<a parentName="p" {...{
        "href": "https://github.com/mushrafulhoque-dsi"
      }}>{`Anik`}</a>{` works in Dhaka, Bangladesh as a Technical Lead and full-stack Software Engineer.`}</p>
    <p><strong parentName="p">{`Tahmid Rahman:`}</strong>{` `}<a parentName="p" {...{
        "href": "https://github.com/tahmidrahman-dsi"
      }}>{`Tahmid`}</a>{` works in Dhaka, Bangladesh as a full-stack Software Engineer.`}</p>
    <p><strong parentName="p">{`Sadman Ilham:`}</strong>{` `}<a parentName="p" {...{
        "href": "https://github.com/Sadman-Ilham"
      }}>{`Sadman`}</a>{` works in Dhaka, Bangladesh as a full-stack Software Engineer.`}</p>
    <h3 {...{
      "id": "honorary-alumni"
    }}>{`Honorary Alumni`}</h3>
    <p><strong parentName="p">{`Ryan Crichton:`}</strong>{` Technical Lead and open source enthusiast, mainly interested in node.js and the javascript community. `}<a parentName="p" {...{
        "href": "https://github.com/rcrichton?tab=overview&org=jembi"
      }}>{`Ryan`}</a>{` works for `}<a parentName="p" {...{
        "href": "https://www.jembi.org/"
      }}>{`Jembi`}</a>{` in Durban, S.A. where he hacks for the greater good on health systems.`}</p>
    <p><strong parentName="p">{`Riku Rouvila:`}</strong>{` `}<a parentName="p" {...{
        "href": "https://github.com/rikukissa"
      }}>{`Riku`}</a>{` is a Technical Lead, full-stack Software Engineer and a popular software development podcast `}<a parentName="p" {...{
        "href": "http://webbidevaus.fi"
      }}>{`host`}</a>{` based in Helsinki.`}</p>
    <p>{`Design and product thanks must be extended to `}<strong parentName="p">{`John Oswald`}</strong>{`, `}<strong parentName="p">{`Isa Jokela-Gomes, George Bevan, Mikkel Nielsen, Alex Crowfoot & Umesh Pandya`}</strong>{` who were part of the original design team for OpenCRVS.`}</p>
